n  // Generic\n  //@import "px-normalize-design/_generic.normalize.scss";\n  //@import "px-box-sizing-design/_generic.box-sizing.scss";\n  @import "px-helpers-design/_generic.helpers.scss";\n\n  // Base\n  @import "px-headings-design/_base.headings.scss";\n\n  // Meta\n\n  // Objects\n\n  // Component\n\n  .kvp-value {\n    color: var(--px-headings-value-color, black);\n  }\n\n  .kvp-value--alpha {\n    margin-top: calculateRem(-10px);\n  }\n\n  .kvp-value--beta {\n    margin-top: calculateRem(-6px);\n  }\n\n  .kvp-value--gamma {\n    margin-top: calculateRem(-12px);\n  }\n\n  .kvp-value--delta {\n    margin-top: calculateRem(-8px);\n  }\n\n  .kvp-value--epsilon {\n    margin-top: calculateRem(-2px);\n  }\n\n  .kvp-value--regular {\n    margin-top: calculateRem(-4px);\n  }\n\n  .kvp-uom--alpha {\n    margin-left: calculateRem(-12px);\n  }\n\n  .kvp-uom--beta {\n    margin-left: calculateRem(-10px);\n  }\n\n  .kvp-uom--gamma {\n    margin-left: calculateRem(-8px);\n  }\n\n  .kvp-uom--delta {\n    margin-left: calculateRem(-4px);\n  }\n\n  .kvp-uom--epsilon {\n    margin-left: calculateRem(-2px);\n  }\n\n  .kvp-uom--regular {\n    margin-left: calculateRem(0px);\n  }\n}\n','////\n/// PX-HELPERS-DESIGN\n/// Defines generic helpers styles\n/// @group px-helpers-design\n////\n\n/**\n * A series of helper classes to use arbitrarily. Only use a helper class if an\n * element/component doesn’t already have a class to which you could apply this\n * styling, e.g. if you need to float `.main-nav` left then add `float:left;` to\n * that ruleset as opposed to adding the `.float--left` class to the markup.\n *\n * A lot of these classes carry `!important` as you will always want them to win\n * out over other selectors.\n */\n\n@import "px-colors-design/_settings.colors.scss";\n\n/// Default breakpoints for palm, palm-and-up, lap, lap-and-up, portable, portable-and-up, desk, desk-and-up, and retina. Predefine this map to override.\n/// @group px-helpers-design:variables:style\n/// @type List [default]\n/// @todo n/a\n$breakpoints: (\n    // backwards compatible\n    "lap"              "screen and (min-width: 45em) and (max-width: 63.9375em)", // 675 - 960\n    "portable"         "screen and (max-width: 63.9375em)", // < 960\n    "desk"             "screen and (min-width: 64em)", // > 960\n\n    // recommended\n    "palm"             "screen and (max-width: 44.9375em)", // < 675\n    "lap-and-up"       "screen and (min-width: 45em)", // > 675\n    "desk-and-up"      "screen and (min-width: 64em)", // > 960\n    "large-and-up"     "screen and (min-width: 120em)", // > 1800\n    "retina"           "(-webkit-min-device-pixel-ratio: 2), (min-resolution: 192dpi), (min-resolution: 2dppx)"\n) !default;\n// @NOTE: The desk-and-up breakpoint is the same as desk, but is useful to keep\n// the same naming convention for SIZE-and-up that the other breakpoints use\n// when defining a min-width query\n\n/// @name media-query\n/// @output Generates whole media queries from the breakpoints defined above\n/// @example\n///   .foo {\n//      color: green;\n//      @include media-query(palm-and-up) {\n//        color: red;\n//      }\n//    }\n@mixin media-query($mq) {\n    $breakpoint-found: false;\n    // Loop through the list of breakpoints we’ve provided in our settings file.\n    @each $breakpoint in $breakpoints {\n        // Grab the alias and the condition from their respective locations in\n        // the list.\n        $alias:     nth($breakpoint, 1);\n        $condition: nth($breakpoint, 2);\n        // If the media query we’ve specified has an alias and a condition...\n        @if $mq == $alias and $condition {\n            // ...tell the mixin that we’ve found it...\n            $breakpoint-found: true;\n            // ...and spit it out here.\n            @media #{$condition} {\n                @content;\n            }\n        }\n    }\n    // If the user specifies a non-exitent alias, send them a warning.\n    @if $breakpoint-found == false{\n        @warn "Oops! Breakpoint ‘#{$mq}’ does not exist."\n    }\n}\n\n/// @name accessibility\n/// @output Properties and values for hiding elements accessibly\n/// @example\n///   position: absolute !important;\n///   overflow: hidden !important;\n///   width: 1px !important;\n///   height: 1px !important;\n///   margin: -1px !important;\n///   border: 0 !important;\n///   padding: 0 !important;\n///   clip: rect(0 0 0 0) !important;\n\n@mixin accessibility {\n  position: absolute !important;\n  overflow: hidden !important;\n  width: 1px !important;\n  height: 1px !important;\n  margin: -1px !important;\n  border: 0 !important;\n  padding: 0 !important;\n  clip: rect(0 0 0 0) !important;\n}\n\n\n/* Links\n   ========================================================================== */\n\n/**\n * Remove the gray background color from active links in IE 10.\n */\n\na {\n  background-color: transparent;\n\n/**\n * Default link colors\n */\n\n  &:link,\n  &:visited {\n    color: $primary-default;\n  }\n\n  &:hover {\n    color: $primary-hover;\n  }\n\n  &:active {\n    color: $primary-pressed;\n  }\n\n/**\n * Improve readability when focused and also mouse hovered in all browsers.\n */\n\n  &:active,\n  &:hover {\n    outline: 0;\n  }\n\n}\n\n/**\n * Add/remove floats\n */\n\n.float--right {\n  float: right !important;\n}\n\n.float--left {\n  float: left !important;\n}\n\n.float--none {\n  float: none !important;\n}\n\n/**\n * Text alignment\n */\n\n.text--left {\n  text-align: left !important;\n}\n\n.text--center {\n  text-align: center !important;\n}\n\n.text--right {\n  text-align: right !important;\n}\n\n/**\n * Full height element\n */\n\n.full-height {\n  height: 100% !important;\n}\n\n/**\n * Add a help cursor to any element that gives the user extra information on\n * `:hover`.\n */\n\n.informative {\n  cursor: help !important;\n}\n\n/**\n * Add a pointer cursor to any element, useful for on-click events\n */\n\n.pointer {\n  cursor: pointer !important;\n}\n\n/**\n * Mute an object by reducing its opacity.\n */\n\n.muted {\n opacity: 0.5 !important;\n}\n\n/**\n * Align items to the right where they imply progression/movement forward, e.g.:\n *\n * <p class=proceed><a href=#>Read more...</a></p>\n *\n */\n\n.proceed {\n  text-align: right !important;\n}\n\n/**\n * Apply capital case to an element (usually a `strong`).\n */\n\n.caps {\n  text-transform: uppercase !important;\n}\n\n/**\n * Hide visually and from screen readers:\n * http://juicystudio.com/article/screen-readers-display-none.php\n */\n\n.hidden {\n  display: none !important;\n  visibility: hidden;\n}\n\n/**\n * Hide content off-screen without resorting to `display:none;`\n */\n\n.a11y,\n.visuallyhidden{\n  @include accessibility;\n}\n\n.a11y,\n.visuallyhidden {\n  &.focusable {\n    &:active,&:focus {\n      position: static;\n      overflow: visible;\n      width: auto;\n      height: auto;\n      margin: 0;\n      clip: auto;\n    }\n  }\n}\n\n@each $breakpoint in $breakpoints {\n  $alias: nth($breakpoint, 1);\n  @include media-query($alias) {\n    .a11y-#{$alias},\n    .visuallyhidden-#{$alias} {\n      @include accessibility;\n    }\n  }\n}\n\n/**\n * Hide visually and from screen readers, but maintain layout\n */\n\n.invisible {\n  visibility: hidden !important;\n}\n\n/**\n * Truncate text with an ellipsis\n */\n\n.truncate {\n  overflow: hidden;\n  text-overflow: ellipsis;\n  white-space: nowrap;\n}\n',"/*------------------------------------*\\\n    #PX-COLORS-DESIGN\n\\*------------------------------------*/\n\n\n/**\n * Neutral Palette (gray20 is darkest, gray1 is lightest)\n */\n$black                          : rgb(0,0,0);\n$gray20                         : rgb(5,9,12);\n$gray19                         : rgb(12,20,25);\n$gray18                         : rgb(18,31,38);\n$gray17                         : rgb(27,42,51);\n$gray16                         : rgb(35,52,63);\n$gray15                         : rgb(44,64,76);\n$gray14                         : 